import React,{useState} from "react";
import "./NewExpenseForm.css";

const NewExpenseForm = () => {
    const [enterdTitle,setEnterTitle] = useState('');
    const [enteredAmount,setEnterAmount] = useState('');
    const [ecteredDate,setEvterDate]=useState('');
    const titleChangeHandler =(event)=>{
        setEnterTitle(event.target.value);
    }
    const amountChangeHandler =(event)=>{
        setEnterAmount(event.target.value);
    }
    const dateChangeHandler=(event)=>{
        setEvterDate(event.target.value);
    }
  return (
    <form>
      <div className="new-expense__controls">
        <div className="new-expense__control">
          <label>Title</label>
          <input type="text" onChange={titleChangeHandler}/>
        </div>
        <div className="new-expense__control">
          <label>Amount</label>
          <input type="number" min="1" step="1" onChange={amountChangeHandler}/>
        </div>
        <div className="new-expense__control">
          <label>Date</label>
          <input type="date" min="2019-01-01" max="2022-12-31" onChange={dateChangeHandler}/>
        </div>
      </div>
      <div className="new-expense__actions">
        <button type="submit">Add New Expense</button>
      </div>
    </form>
  );
};
export default NewExpenseForm;
